import React, { useState } from "react";
import axios from "axios";

function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [showPassword, setShowPassword] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post("http://localhost:5000/api/auth/login", {
        email,
        password,
      });
      alert("Đăng nhập thành công!");
      console.log(res.data);
    } catch (err) {
      alert("Đăng nhập thất bại!");
      console.error(err);
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h2 style={styles.title}>Đăng nhập</h2>

        <form onSubmit={handleSubmit} style={{ width: "100%" }}>
          {/* Email */}
          <div style={styles.inputWrapper}>
            <input
              type="email"
              placeholder="Nhập email"
              className="input-field"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>

          {/* Mật khẩu + icon con mắt */}
          <div style={styles.inputWrapper}>
            <input
              type={showPassword ? "text" : "password"}
              placeholder="Nhập mật khẩu"
              className="input-field"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <button
              type="button"
              aria-label={showPassword ? "Ẩn mật khẩu" : "Hiện mật khẩu"}
              onClick={() => setShowPassword((s) => !s)}
              style={styles.iconButton}
            >
              {showPassword ? (
                // Eye-off SVG
                <svg
                  width="20"
                  height="20"
                  viewBox="0 0 24 24"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <path
                    d="M3 3l18 18"
                    stroke="#374151"
                    strokeWidth="1.6"
                    strokeLinecap="round"
                    strokeLinejoin="round"
                  />
                  <path
                    d="M10.58 10.58a3 3 0 0 0 4.24 4.24"
                    stroke="#374151"
                    strokeWidth="1.6"
                    strokeLinecap="round"
                    strokeLinejoin="round"
                  />
                  <path
                    d="M14.12 9.88C15.01 10.77 15.6 11.93 15.6 13.2c0 2.21-1.79 4-4 4-1.27 0-2.43-.59-3.32-1.48"
                    stroke="#374151"
                    strokeWidth="1.6"
                    strokeLinecap="round"
                    strokeLinejoin="round"
                  />
                  <path
                    d="M2.5 12c2.5-4.5 7-7 12-7 1.73 0 3.39.36 4.9 1.02"
                    stroke="#374151"
                    strokeWidth="1.6"
                    strokeLinecap="round"
                    strokeLinejoin="round"
                  />
                  <path
                    d="M21.5 12c-1.16 2.09-2.96 3.77-5.06 4.7"
                    stroke="#374151"
                    strokeWidth="1.6"
                    strokeLinecap="round"
                    strokeLinejoin="round"
                  />
                </svg>
              ) : (
                // Eye SVG
                <svg
                  width="20"
                  height="20"
                  viewBox="0 0 24 24"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <path
                    d="M1.5 12s4-7.5 10.5-7.5S22.5 12 22.5 12s-4 7.5-10.5 7.5S1.5 12 1.5 12z"
                    stroke="#374151"
                    strokeWidth="1.6"
                    strokeLinecap="round"
                    strokeLinejoin="round"
                  />
                  <circle
                    cx="12"
                    cy="12"
                    r="3"
                    stroke="#374151"
                    strokeWidth="1.6"
                    strokeLinecap="round"
                    strokeLinejoin="round"
                  />
                </svg>
              )}
            </button>
          </div>

          {/* Nút đăng nhập */}
          <button type="submit" className="btn-submit">
            Đăng nhập
          </button>
        </form>
      </div>

      {/* CSS nội tuyến */}
      <style>
        {`
          .input-field {
            width: 100%;
            height: 48px;
            line-height: 48px;
            padding: 0 44px 0 16px;
            border: 1px solid #e6edf6;
            border-radius: 12px;
            outline: none;
            font-size: 15px;
            transition: 0.3s;
            box-sizing: border-box;
          }
          .input-field:focus {
            border-color: #4f46e5;
            box-shadow: 0 0 6px rgba(79,70,229,0.3);
          }

          .btn-submit {
            width: 100%;
            padding: 13px 14px;
            background: linear-gradient(135deg, #4f46e5 0%, #3b82f6 100%);
            color: white;
            border: none;
            border-radius: 12px;
            font-size: 16px;
            cursor: pointer;
            font-weight: 600;
            transition: transform 0.2s, box-shadow 0.2s;
          }

          .btn-submit:hover {
            transform: scale(1.02);
            box-shadow: 0 4px 12px rgba(59,130,246,0.4);
          }

          /* Fix Safari căn giữa icon */
          @supports (-webkit-touch-callout: none) {
            button[aria-label*="mật khẩu"] {
              transform: translateY(-50%) !important;
            }
          }
        `}
      </style>
    </div>
  );
}

const styles = {
  container: {
    height: "100vh",
    background: "linear-gradient(135deg, #c2e9fb 0%, #a1c4fd 100%)",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    fontFamily: "Arial, sans-serif",
    padding: "20px",
  },
  card: {
    background: "#fff",
    padding: "40px 30px",
    borderRadius: "18px",
    boxShadow: "0 10px 30px rgba(16,24,40,0.08)",
    width: "400px",
    textAlign: "center",
  },
  title: {
    marginBottom: "20px",
    fontSize: "24px",
    fontWeight: "700",
    color: "#0f172a",
  },
  inputWrapper: {
    position: "relative",
    display: "flex",
    alignItems: "center",
    width: "100%",
    marginBottom: "15px",
  },
  iconButton: {
    position: "absolute",
    right: "14px",
    top: "50%",
    transform: "translateY(-50%)",
    background: "transparent",
    border: "none",
    cursor: "pointer",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    padding: "4px",
  },
};

export default Login;
